INSERT INTO `products` VALUES (72,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.ld40tiwifl_Laptop%20Acer%20TravelMate%20B3?alt=media&token=33a286cd-41d7-41c3-bcb7-e581fc5edf90','Laptop Acer TravelMate B3 TMB311 31 P49D (NX.VNFSV.005) là mẫu laptop được thiết kế dành cho các em học sinh thuộc phân khúc giá thấp với vẻ ngoài mang phong cách tối giản,\n	bền bỉ cùng hiệu năng ổn định, phục vụ tốt cho nhu cầu học tập.\n	Thiết kế đơn giản, chắc chắn Acer TravelMate B3 được chế tác từ chất liệu nhựa cứng cáp, trọng lượng 1.4 kg và độ dày 20.99 mm,\n	gọn gàng để các bé đặt ở bất kỳ đâu trong không gian phòng học, phòng khách,... để học trực tuyến mà không lo chiếm quá nhiều diện tích.\n	Đặc biệt, chiếc laptop Acer TravelMate này trang bị bàn phím có các rãnh thoát nước và dãy phím được gia công chắc\n	chắn không thể gỡ ra được nhưng dễ thay lắp khi hư hỏng, bậc phụ huynh yên tâm khi bé lỡ làm đổ nước hay khi ngồi học một mình.\n	Độ bền chuẩn quân đội MIL STD 810G được trang bị gia tăng độ bền của máy trước các tác động từ môi trường như nhiệt độ, bụi bẩn, rung lắc, va đập không mong muốn,...\n	Để phục vụ tối ưu cho nhu cầu học tập của các bé, laptop hỗ trợ đầy đủ các cổng kết nối bao gồm: 2 cổng USB 3.2, Type-C, HDMI, LAN, Jack tai nghe 3.5 mm việc\n	xuất hình ảnh hay kết nối với các thiết bị ngoại vi khác đều sẽ dễ dàng, nhanh chóng.',5490000,'Laptop Acer TravelMate B3','24 Tháng',7,10,'2022-11-13 11:29:19.000000'),(88,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.d61sgvfzijd_Lenovo%20Gaming%20Legion%205%20i7?alt=media&token=6a27cab5-1604-4800-b986-7eddbe975b4d','Phong cách thiết kế độc đáo, trẻ trung cùng hiệu năng mạnh mẽ vượt trội của card màn hình NVIDIA RTX hội tụ trong chiếc laptop Lenovo Gaming Legion 5 15ITH6 i7\n	(82JK00FNVN) hứa hẹn sẽ cân mọi tựa game đình đám cũng như sẵn sàng hỗ trợ bạn xử lý các tác vụ nặng.Hiệu năng mạnh mẽ vượt trội cân mọi tác vụ \n	Đầu tiên là đến với con game bắn súng quốc dân Battlefield 1, máy vận hành mượt mà với trung bình 75 FPS. Ở đây chúng ta sẽ thấy CPU Intel Core i7 11800H hiệu năng cao chỉ phải\n	hoạt động tầm 42% công suất, card màn hình NVIDIA RTX 3050Ti cũng chỉ hơi mạnh hơn CPU một xíu với 69% công suất.Chuyển sang tựa game đua xe mô phỏng Forza Horizon đã mang đến\n	cho mình từng khung hình sắc nét, cảnh vật xung quanh trong thế giới game chân thật, chi tiết. Nếu bạn là fan của tựa game thế giới mở, chiếc máy sẽ làm hài lòng bạn với\n	trung bình 90 FPS. Trong đó công suất CPU chạy ở mức 60% và GPU là 96%. Ở tựa game này theo trải nghiệm bản thân, máy cũng không quá nóng, nhiệt độ tản ra đều và không gây\n	khó chịu. Đối với tựa game có mức đồ hoạ cao hơn thì máy vẫn cho ra một mức FPS ổn định và trơn tru.',35990000,'Lenovo Gaming Legion 5 i7','24 Tháng',7,11,'2022-11-12 08:00:24.000000'),(375,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.7dqkub1oe1o_Laptop%20Asus%20Gaming%20ROG%20Flow%20z13?alt=media&token=fc85b167-d07a-4019-b43f-affb66113efd','laptop Asus Gaming ROG Flow Z13 GZ301Z i7 (LD110W) là một trong những siêu phẩm đáng mua trong tầm giá bởi nó là sự kết hợp hoàn hảo giữa chiếc laptop gaming mỏng nhẹ,di động nhất và tablet Windows mạnh mẽ nhất.Ngoại hình cơ động, đậm chất viễn tưởng Thoạt nhìn, tưởng chừng như Asus ROG mang một diện mạo tựa như các dòng laptop Surface Pro của nhà Microsoft nhưng khi cầm em máy trên tay để ngắm nghía thì nó lại sở hữu một khí chất rất riêng, phong thái kiêu kỳ pha tí hầm hố gaming không lẫn vào đâu của Asus,điều đó làm cho Asus rất thành công trong việc thu hút ánh nhìn của người khác mỗi khi mình mang em máy này theo bên người.Ở phương diện máy tính bảng, con số 1.18 kg chưa phải là một trọng lượng nhẹ nhàng hay cân đối nhưng nếu xét ở khía cạnh máy tính xách tay, mình khá ưng ý với em ROG Flow này bởi tính di động cực cao mà hiếm có dòng laptop gaming nào qua mặt được.Bản lề của laptop được Asus làm rất cứng cáp và chắc chắn. Cạnh ngoài rìa có miếng cao su khắc chữ ROG nhỏ nhắn vừa tăng tính thẩm mỹ cho máy vừa giúp mình mở phần chân dựng máy ra dễ dàng hơn rất nhiều. Tuy đôi lúc việc mở máy ở góc tầm 90 - 170 độ hơi khó khăn với mình nhưng nó có thể đảm bảo sự chắc chắn và an toàn cho máy thì việc đó hoàn toàn có thể chấp nhận được.Asus rất thích tạo điểm nhấn cho các dòng sản phẩm của mình bằng những vết cắt xén tinh tế và chiếc ROG Flow này cũng không ngoại lệ.Lần này thì những đường cắt trên thân máy của Flow Z13 lại vô cùng độc đáo khi để lộ ra 1 phần ô nhỏ chứa các bo mạch máy bên trong, kết hợp dải đèn LED RGB với nhiều màu bắt mắt, mình đã thật sự ấn tượng và bị thu hút ngay từ lần đầu tiên với phong cách thiết kế quá đẹp và đậm chất Asus như này.',49490000,'Laptop Asus Gaming ROG Flow z13','12 Tháng',7,12,'2022-11-20 15:32:00.577000'),(386,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.sz15wfxdrld_Laptop%20GIGABYTE%20Gaming%20G5Laptop%20GIGABYTE%20Gaming%20G5?alt=media&token=91077b7a-b5d6-4709-94e8-91a8a564621e','Tác chiến trên mọi chiến trường ảo một cách đầy thuận lợi cùng laptop GIGABYTE Gaming G5 i5 (5S11130SH), với kiểu dáng mạnh mẽ cùng hiệu năng tân tiến, sẵn sàng đồng hành cùng bạn ở bất kỳ đâu.Sức mạnh hiệu năng được thiết kế tối tânXử lý nhanh gọn và hiệu quả hàng loạt tác vụ văn phòng trên các ứng dụng Word, Excel,.. nhờ năng suất vượt trội của CPU Intel Core i5 Comet Lake 10500H sở hữu cấu trúc 6 nhân 12 luồng, cho tốc độ cơ bản 2.50 GHz và đạt tối đa lên đến 4.5 GHz Turbo Boost, đồng thời cho bạn trải nghiệm mọi thể loại game kịch tính như Cyberpunk 2077, FIFA, PUBG: Battlegrounds,... Đa nhiệm hơn bao giờ hết khi sở hữu bộ nhớ RAM 16 GB chuẩn DDR4 2 khe (1 khe 8 GB + 1 khe 8 GB) với tốc độ bus RAM 3200 MHz, hỗ trợ người dùng mở và vận hành nhiều ứng dụng cùng lúc, cho phép di chuyển qua lại mà không xảy ra tình trạng giật hay lag máy. Hơn thế nữa, GIGABYTE còn mang đến khả năng nâng cấp RAM tối đa lên đến 64 GB, đáp ứng mọi nhu cầu của bạn.Được sản xuất dựa trên kiến trúc Ampere tân tiến, card đồ họa rời NVIDIA GeForce RTX 3060, 6GB  cho phép người dùng thỏa sức sáng tạo với việc chỉnh sửa hình ảnh, render video,... một cách mượt mà với các ứng dụng nhà Adobe. Không những thế bạn sẽ được tận hưởng các chuyển động mượt mà trong các tựa game từ đơn giản đến phức tạp mà không xảy ra hiện tượng giật lag hay bóng ma.Không gian lưu trữ rộng lớn đến từ ổ cứng SSD 512 GB NVMe PCle, đồng thời hỗ trợ mở và vận hành máy hay các ứng dụng một cách nhanh chóng chỉ trong vài giây. Đặc biệt,người dùng có thể dễ dàng tháo lắp thay thế bằng thanh khác tối đa 1 TB, tối ưu hơn cho mọi yêu cầu từ bạn.Nâng cấp bộ nhớ dễ dàng và thuận lợi hơn nhờ laptop được thiết kế thêm khe cắm HDD SATA (nâng cấp tối đa 2 TB) và SSD M.2 PCIe mở rộng (nâng cấp tối đa 1 TB), hỗ trợ bạn làm việc và giải trí thoải mái hơn bao giờ hết.',24990000,'Laptop GIGABYTE Gaming G5','36 Tháng',7,13,'2022-11-20 15:38:21.774000'),(398,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.nutltuoy0x_Laptop%20Acer%20Nitro%205%20Gaming%20an515?alt=media&token=3005529a-fa39-445e-b31b-25caedfd0a4f','Phá cách với diện mạo mạnh mẽ đến từ laptop Acer Nitro 5 Gaming AN515 45 R6EV R5 5600H (NH.QBMSV.006) mang đến cho người dùng hiệu năng ổn định, hỗ trợ bạn trong mọi tác vụ hằng ngày hay chiến những trận game cực căng một cách mượt mà.Kiểu dáng nổi bật, thu hút mọi ánh nhìn Laptop Acer Nitro với tính bền bỉ vượt bậc khi được trang bị lớp vỏ nhựa chắc chắn cùng trọng lượng không quá nặng cho một chiếc laptop gaming 2.2 kg và dày 23.9 mm, sẵn sàng cùng bạn đi đến bất kỳ đâu, phục vụ tốt cho cả nhu cầu công việc hay giải trí, cho phép bạn chiến game ở khắp mọi nơi trong cuộc hành trình.Bàn phím Fullsize được thiết kế đèn nền chuyển màu RGB của laptop Acer được thiết kế tinh tế nhưng vẫn tôn lên nét mạnh mẽ của một chiếc gaming mạnh mẽ, với các phím có độ nảy tốt, cho bạn thoải mái sử dụng cả trong điều kiện ánh sáng kém mà không lo nhầm lẫn.Dọc hai bên laptop được trang bị các cổng giao tiếp thông dụng hỗ trợ tốt cho nhu cầu truyền xuất dữ liệu hay chia sẻ thông tin đến các thiết bị ngoại vi tương thích như 3 cổng USB 3.2, HDMI, Jack tai nghe 3.5 mm, LAN (RJ45) và USB Type-C.Các chuẩn kết nối không dây Bluetooth 5.0 và Wi-Fi 6 (802.11ax) cung cấp đường truyền ổn định trong suốt quá trình làm việc hay giải trí ở cả trong nhà, ngoài trời, nâng cao năng suất công việc của bạn.',23990000,'Laptop Acer Nitro 5 Gaming an515','12 Tháng',7,10,'2022-11-20 15:44:19.101000'),(412,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.z0jpknggbtr_Laptop%20MSI%20Gaming%20GE66%20Raider%2011UG?alt=media&token=c482799d-7423-4147-b026-8c2bb9f4696d','Vươn lên tầm cao mới cùng laptop MSI Gaming GE66 Raider 11UG i7 11800H (258VN) với thiết kế độc lạ, đem đến vô vàn tính năng cao, chinh phục mọi công việc khó nhằn hay chiến đấu cực đỉnh trên mọi chiến trường game. Bức phá sức mạnh nhờ chip Intel Gen 11 Core i7 Phát huy tối đa hiệu suất trong công việc nhờ bộ vi xử lý Intel Core i7 Tiger Lake 11800H với 8 nhân 16 luồng, đạt tốc độ CPU 2.30 GHz và tối đa lên đến 4.6 GHz nhờ Turbo Boost, thỏa mãn bạn trong việc xử lý gọn nhẹ các tác vụ công việc từ văn phòng đến đồ hoạ nâng cao, chỉnh sửa hình ảnh phức tạp, kết xuất 3D,... không gì có thể cản trở hay chinh chiến đầy mạnh mẽ trong mọi trận chiến game.Nâng cấp trải nghiệm lên một tầm cao mới nhờ RAM 16 GB chuẩn DDR4 2 khe (1 khe 8 GB + 1 khe 8 GB) với tốc độ Bus RAM 3200 MHz, đem lại sự đa nhiệm ấn tượng, cho phép người dùng mở nhiều tab hay ứng dụng và chuyển đổi qua lại mà không lo giật hay lag máy. Bên cạnh đó, hỗ trợ nâng cấp RAM tối đa 64 GB, đáp ứng tối đa nhu cầu của người dùng.Xuất hiện trên các mẫu laptop mạnh nhất cho game thủ hay sáng tạo nội dung chuyên nghiệp, nhờ card đồ họa rời NVIDIA GeForce RTX 3070, 8 GB, cho những hình ảnh đồ họa chân thật,đem lại tốc độ khung hình siêu nhanh, cho phép bạn thỏa sức chiến các game thịnh hành đầy hấp dẫn như PUBG: Battlegrounds, LOL, FIFA,... hay phát triển những ý tưởng đồ họa không giới hạn cùng Lightroom, Illustrator, Photoshop,...Chuyển đổi dễ dàng giữa chế độ chỉ sử dụng card đồ họa rời (Discrete Graphics Mode) hoặc sử dụng công nghệ NVIDIA Optimus (MSHybrid Graphics Mode), đem đến hiệu năng xử lý tối đa.Hơn thế nữa, sức mạnh đồ họa được nâng cao đáng kể khi chọn chế độ Extreme mode trên phần mềm MSI Center.Tốc độ mở và vận hành máy hay các ứng dụng đáng kinh ngạc nhờ ổ cứng SSD 2 TB NVMe PCle. Đồng thời, đem đến một bộ nhớ khổng lồ, cho bạn thoải mái lưu trữ hàng loạt sản phẩm thiết kế tâm đắc, bộ phim hay tựa game yêu thích.\n	',58990000,'Laptop MSI Gaming GE66 Raider 11UG','12 Tháng',7,14,'2022-11-20 16:04:21.580000'),(425,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.rl8roftwlj_Laptop%20Lenovo%20IdeaPad%20Gaming%203?alt=media&token=040b38d0-6942-4522-943f-af13f441f519','Gam màu đen huyền bí cùng những chi tiết góc cạnh hầm hố làm nên chiếc laptop Lenovo IdeaPad Gaming 3 15IHU6 i5 (82K10178VN) chuẩn laptop gaming với cấu hình mạnh mẽ của chip Intel Gen 11 và card NVIDIA GTX sẽ làm hài lòng nhu cầu chơi game giải trí cho bạn.Laptop Lenovo mang trong mình CPU Intel Core i5 11300H mạnh mẽ cùng card màn hình rời NVIDIA GTX 1650 4 GB sẵn sàng cân các tựa game hiện hành: GTA V, CS:GO, LOL,... mượt mà cũng như tác vụ Office, chỉnh sửa thiết kế ảnh Adobe với hiệu suất ổn định.Laptop sở hữu RAM 8 GB mang lại khả năng đa nhiệm tốt các tác vụ nhẹ, chơi game ổn định, khuyến khích bạn nên nâng cấp RAM để máy chạy hết công suất. SSD 512 GB cho không gian lưu trữ vừa đủ, khởi động ứng dụng, máy tính nhanh.Màn hình laptop Lenovo IdeaPad Gaming có kích thước 15.6 inch cùng tần số quét 120 Hz bổ trợ cho trải nghiệm hình ảnh chơi game, hạn chế tình trạng xé hình.Tiện ích tích hợp theo máy gồm TPM 2.0 giúp bảo vệ dữ liệu thông qua mã hoá ổ cứng, công tắc khoá camera để bảo vệ camera khỏi bụi bẩn. Đèn nền bàn phím chyển màu RGB cho phép người dùng cá nhân hoá màu sắc theo sở thích.Đa dạng cổng giao tiếp: USB 3.2, LAN (RJ45), HDMI, USB Type-C,...Công nghệ Nahimic Audio cho chất âm tốt, cảm nhận chơi game đã tai, hoà mình vào thế giới ảo đầy màu sắc.',18890000,'Laptop Lenovo IdeaPad Gaming 3','12 Tháng',7,11,'2022-11-20 16:09:16.068000'),(434,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.srw5m0wdutc_Laptop%20Asus%20TUF%20Gaming%20FX506LH?alt=media&token=278c4794-bcc6-4e1c-b874-3e8145063774','Với cấu hình khoẻ từ card rời NVIDIA GeForce GTX cùng một thiết kế ấn tượng, laptop Asus TUF Gaming FX506LH i5 (HN188W) sẽ mang đến nhiều trải nghiệm thú vị cho các game thủ.Sở hữu chip Intel Core i5 Comet Lake 10300H và card GeForce GTX 1650 4 GB từ nhà NVIDIA xử lý hoàn hảo mọi nhu cầu từ văn phòng đến đồ họa nặng hay thậm chí hỗ trợ bạn chiến các tựa game hấp dẫn: CS:GO, Fifa Online 4, GTA V,...Cùng RAM 8 GB và SSD 512 GB nâng cao tốc độ phản hồi, hạn chế tình trạng giật hay lag máy khi bạn mở nhiều ứng dụng cùng lúc hay chuyển đổi qua lại, tối ưu hiệu suất cho laptop.Các chuyển động diễn ra trơn tru, nắm bắt mọi khoảnh khắc trong game, giảm độ trễ nhờ tần số quét 144 Hz.Độ sáng 250 nits, chống chói Anti Glare và tấm nền IPS được trang bị trên màn hình 15.6 inch hạn chế hiện bóng gương khi cường độ ánh sáng cao, cho hiển thị rõ nét ở những chỗ điều kiện ánh sáng kém, góc nhìn được mở rộng, trải nghiệm hình ảnh sắc nét, chân thật.Laptop Asus TUF mang một ngoại hình mạnh mẽ với các đường nét tinh tế, góc cạnh cùng trọng lượng 2.3 kg, dày 24.9 mm, tạo nên chiếc laptop gaming cực cá tính, sẵn sàng đồng hành cùng bạn.Đèn nền chuyển màu RGB cũng được cài đặt trên laptop Asus không chỉ tô điểm cho không gian chiến game của bạn mà còn hỗ trợ bạn gõ phím chính xác trong những nơi thiếu sáng.Đáp ứng đa dạng cổng kết nối như: USB 3.2 Gen 2 Type-C,