 11UH i7 (259VN) thuộc dòng laptop gaming cao cấp của nhà MSI, sở hữu thiết kế độc đáo với cấu hình mạnh mẽ cùng hiệu suất chơi game gần như hoàn hảo nhờ sở hữu con chip Intel Gen 11 hiện đại. Đây chắc chắn sẽ là chiếc laptop mang đến cho bạn những giây phút giải trí tuyệt vời.Sức mạnh nổi bật nhờ công nghệ tiên tiến MSI Gaming GE66 được trang bị bộ vi xử lý Intel Core i7 Tiger Lake 11800H với cấu trúc 8 nhân 16 luồng, mức xung nhịp trung bình là 2.3 GHz và đạt tối đa 4.6 GHz nhờ Turbo Boost giúp bạn hoàn thành mọi công việc một cách mượt mà nhất. Xử lý nhanh gọn các tính năng văn phòng phức tạp trên Word, Excel,... hay chỉnh sửa hình ảnh với dung lượng cao, thiết kế poster, render video,... cũng tuyệt vời không kém mà còn tiết kiệm điện năng vượt trội.RAM 32 GB tốc độ Bus RAM 3200 MHz cho hiệu năng vượt trội, khả năng đa nhiệm nhiều tác vụ cùng lúc, chơi game hay phát sóng trực tiếp đều mượt mà. Ngoài ra, bạn có thể nâng cấp lên đến 64 GB khi có nhu cầu trải nghiệm máy ở tốc độ cao hơn nữa.Card đồ họa rời NVIDIA GeForce RTX 3080 16 GB cho bạn thoải mái chiến các tựa game hot hiện nay: Cyberpunk 2077,Valorant, CS:GO, Naraka: Bladepoint, Fifa Online 4,... ở mức cài đặt cao hay đẩy mạnh hiệu suất công việc, thỏa sức sáng tạo nội dung, kết xuất 2D, 3D, render video qua các ứng dụng Photoshop, AI, Lightroom, Pr, Figma,...Bên cạnh đó, bạn có thể tùy chỉnh, chuyển đổi card đồ họa giữa chế độ chỉ sử dụng card đồ họa rời(Discrete Graphics Mode) hay NVIDIA Optimus (MSHybrid Graphics Mode). Đồng thời, sức mạnh đồ họa còn có thể được nâng cao hơn nữa thông qua việc ép xung GPU và VRAM trên phần mềm MSI Center (khi chọn chế độ hoạt động là Extreme mode).Hơn thế nữa, MSI còn được trang bị ổ cứng SSD 2 TB NVMe PCIe hỗ trợ thêm 1 khe cắm SSD M.2 PCIe mở rộng (nâng cấp tối đa 2 TB), cho tốc độ phản hồi nhanh chóng, đem đến không gian lưu trữ khổng lồ, cho phép người dùng thoải mái tải về mọi tài liệu, ứng dụng, bộ phim yêu thích hay các bộ game hấp dẫn.Đặc biệt, hệ thống tản nhiệt hiện đại với công nghệ độc quyền CoolerBoost 5 với 2 quạt,6 ống đồng cùng với 4 khe thoát khí, tối ưu hiệu suất hoạt động khi người dùng chơi game trong nhiều giờ liền, không lo tình trạng quá tải nhiệt độ.',73990000,'Laptop MSI Gaming GE66 Raider 11UH','36 Tháng',7,14,'2022-11-20 16:24:56.761000'),(474,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.6s5rqp9yzls_Laptop%20MSI%20Gaming%20GS66%20Stealth%2011UG?alt=media&token=02c06d9e-0151-4068-849f-b833a7379941','Xứng danh tay chơi cự phách nơi đô thị sầm uất, laptop MSI Gaming GS66 Stealth 11UG i7 11800H (219VN) với vẻ ngoài đầy mạnh mẽ cùng sức mạnh tuyệt hảo, phát huy hiệu suất tối ưu và khả năng chiến game cực đã cùng đồng đội.Ấn tượng với vẻ ngoài sắc sảo, phá vỡ mọi giới hạn.Sở hữu kiểu dáng cơ động với thiết kế đen nhám mang phong cách chân phương, cùng lớp vỏ kim loại được gia cường cứng cáp, đã mang đến một phiên bản laptop đầy mạnh mẽ, sẵn sàng trở thành người cộng sự đáng tin cậy, đáp ứng tốt mọi nhu cầu của bạn.MSI Gaming vẫn là một chiếc laptop di động, linh hoạt trong phân khúc gaming với trọng lượng chỉ 2.1 kg và độ dày 19.8 mm, đồng hành cùng bạn đến bất cứ đâu, phục vụ tốt cho các nhu cầu chơi game giải trí lẫn làm việc đầy chuyên nghiệp.Bản lề gập mở 180 độ giúp tăng độ bền cho máy hơn, đồng thời dễ dàng cho bạn chia sẽ màn hình với người khác, thỏa sức trình bày ý tưởng trong các cuộc họp.Nổi bật cá tính khi bàn phím được trang bị đèn nền chuyển màu RGB, tùy chỉnh từng phím theo sở thích, theo dõi thông số trong game qua bàn phím, thậm chí là xem đèn nền phím nhảy theo điệu nhạc, vừa tăng sự thích thú khi chiến game cùng bạn bè, vừa giúp người dùng khả năng sử dụng máy trong điều kiện thiếu sáng dễ dàng hơn. Làm việc hay giải trí một cách hiệu quả, thú vị nhờ các cổng kết nối HDMI, Thunderbolt 4 USB-C, USB 3.2 và USB Type-C, giúp người dùng liên kết và chia sẻ thông tin với các thiết bị ngoại vi tương thích dễ dàng hơn, mở rộng không gian hiển thị 