6 11UG i7 (823VN) sở hữu phần cứng được tối ưu đến mức tối đa, dễ dàng đáp ứng mọi nhu cầu từ bạn.Sức mạnh hoàn mỹ đến từ chip Intel thế hệ 11 .Thỏa mãn bạn trong mọi tác vụ từ cơ bản đến nâng cao trong các công việc văn phòng, đồ họa hay gaming một cách mượt mà khi chiếc laptop này được trang bị bộ vi xử lý Intel Core i7 Tiger Lake 11800H với 8 nhân 16 luồng, đạt tốc độ CPU 2.30 GHz và tối đa lên đến 4.6 GHz nhờ Turbo Boost, cho phép bạn bức phá mọi giới hạn, không gì có thể cản bước.Nâng tầm trải nghiệm nhờ RAM 16 GB chuẩn DDR4 2 khe (1 khe 8 GB + 1 khe 8 GB) với tốc độ Bus RAM 3200 MHz, cùng khả năng nâng cấp RAM tối đa lên đến 64 GB, cho phép người dùng làm nhiều việc cùng lúc như vừa lên ý tưởng thiết kế vừa nghe nhạc, mở nhiều ứng dụng hay hàng chục layer đồ họa và chuyển đổi qua lại một cách trơn tru, không lo xảy ra tình trạng giật lag, nâng cao hiệu suất công việc.Áp dụng kiến trúc Ampere uy tính với nhân RT, nhân Tensor tân tiến cùng đa nhân xử lý streaming, mang đến đồ họa ray-tracing chân thật nhất và các tính năng AI hiện đại, card đồ họa rời NVIDIA GeForce RTX 3070, 8 GB cho phép bạn thoải mái phát triển những ý tưởng đồ họa không giới hạn cùng Lightroom, Illustrator, Photoshop,... hay tận hưởng trọn vẹn những trận game đầy kịch tính như LOL, PUBG: Battlegrounds, FIFA,...Cho phép người dùng dễ dàng chuyển đổi giữa chế độ Discrete Graphics Mode (chỉ sử dụng card đồ họa rời) hoặc MSHybrid Graphics Mode (sử dụng công nghệ NVIDIA Optimus), cho bạn tận dụng tối đa hiệu năng của máy. Không những thế, sức mạnh của card đồ họa còn được nâng tầm đáng kể qua khả năng ép xung của GPU và VRAM khi sử bật chế độ Extreme mode trên phần mềm MSI Center.Laptop 1 TB SSD M.2 PCIe (Có thể tháo ra, lắp thanh khác tối đa 2 TB) cùng khe cắm SSD M.2 PCIe mở rộng (nâng cấp tối đa 2 TB) với băng thông cực cao cho phép máy phát huy tối đa sức mạnh, vừa mang đến không gian lưu trữ khổng lồ, vừa hỗ trợ bạn mở máy và vận hành các ứng dụng trong thời gian nhanh chóng, luôn ở trạng thái sẵn sàng cho bạn làm việc, giải trí.',51990000,'Laptop MSI Gaming Leopard GP76 11UG','36 Tháng',7,14,'2022-11-20 16:38:49.268000'),(510,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.zascosregl_Laptop%20MSI%20Gaming%20Stealth%2015M%20A11UEK?alt=media&token=7d9e5bc3-6ee4-4a1b-b3a4-305243113790','Lấy cảm hứng từ phong cách đô thị, MSI Gaming Stealth 15M A11UEK i7 (254VN) mang thiết kế gaming hiện đại, mạnh mẽ cùng bộ cấu hình vượt trội cho hiệu suất tối ưu để chiến game đỉnh cao và thiết kế đồ họa chuyên nghiệp.Đột phá mọi giới hạn với con chip Intel thế hệ 11 tân tiến.Chiếc laptop MSI Gaming này sở hữu bộ CPU Intel Core i7 Tiger Lake 11375H cấu trúc 4 nhân 8 luồng, có tốc độ xung nhịp cơ bản 3.30 GHz và đạt tối đa lên đến Turbo Boost 5.0 GHz cung cấp một sức mạnh hiệu năng cực mạnh mẽ cho bạn thỏa sức chiến các tựa game hot ở mức cài đặt cao như: PUBG: Battlegrounds, Valorant, CS:GO, Fifa Online 4,... hay thiết kế đồ họa chuyên dụng cũng như cân mọi tác vụ văn phòng hàng ngày.Đa tác vụ siêu mượt mà với bộ nhớ RAM 16 GB chuẩn DDR4 2 khe (1 khe 8 GB + 1 khe 8 GB) tốc độ Bus RAM 3200 MHz cho phép người dùng thoải mái mở nhiều ứng dụng cùng lúc, vừa học tập, làm việc và giải trí mà không lo xảy ra hiện tượng giật lag, đơ máy. Ngoài ra, bạn còn có thể nâng cấp tối đa 64 GB để nâng cao trải nghiệm hơn nữa.Card đồ họa rời NVIDIA GeForce RTX 3060 Max-Q 6 GB sử dụng kiến trúc Ampere với nhân RT và nhân Tensor mới, cùng với đa nhân xử lý streaming giúp đem lại đồ họa ray-tracing siêu chân thực và các tính năng AI tân tiến nhất, mang lại tốc độ hiển thị siêu mượt cho các trận game đầy kịch tính ở mức cài đặt cao cũng như thỏa sức sáng tạo, chỉnh sửa hình ảnh 2D, 3D phức tạp, render video bằng các công cụ Lightroom, Illustrator, Photoshop, Figma, Pr,...\n	Ổ cứng SSD 512 GB NVMe PCIe có thể tháo ra, lắp thanh khác tối đa 2 TB, giúp vận hành máy hay khởi chạy các ứng dụng một cách nhanh chóng vượt trội, đồng thời mang đến kho