t kế độc đáo cùng card đồ họa NVIDIA GeForce mạnh mẽ, laptop Lenovo Gaming Legion 5 15ACH6 (82JW00KLVN) đáp ứng tốt mọi tác vụ từ học tập, văn phòng nhẹ nhàng đến đồ họa, kỹ thuật chuyên sâu.Xử lý mọi nhu cầu làm việc hay giải trí cơ bản nhờ bộ vi xử lý AMD Ryzen 5 5600H, hỗ trợ bạn chiến các tựa game như CS:GO, GTA V, PUBG, LOL,... với card đồ họa rời NVIDIA GeForce RTX3050 4 GB mạnh mẽ.Bộ nhớ RAM 8 GB cho phép bạn mở hàng loạt cửa sổ ứng dụng cùng lúc, ổ cứng SSD 512 GB cùng khe cắm SSD M.2 PCIe mở rộng mang đến không gian lưu trữ tốt, đáp ứng tối đa nhu cầu công việc. Laptop gaming có tần số quét 165 Hz cho độ trễ thấp, màn hình 100% sRGB cùng công nghệ Dolby Vision tái tạo các gam màu sắc một cách chuẩn xác, tươi mới.Laptop màn hình 15.6 inch cùng tấm nền IPS hiện đại cho góc nhìn bao quát. Độ phân giải Full HD (1920 x 1080) và công nghệ Anti Glare cung cấp chất lượng hình ảnh rõ nét, bảo vệ thị giác người xem, giảm thiểu hiện tượng chói.Laptop Lenovo Gaming Legion sở hữu thiết kế độc đáo với chiếc logo nổi bật trên lớp vỏ nhựa bền chắc, trọng lượng 2.4 kg luôn trong tư thế sẵn sàng chiến đấu bất cứ khi nào bạn cần.Máy được trang bị công tác khóa camera hiện đại. Laptop Lenovo còn trang bị đèn nền phím đơn sắc cho phép bạn làm việc hay chiến game ngay cả trong môi trường thiếu sáng.Đa dạng các cổng kết nối hiện đại được trang bị trên laptop như 1 x USB 3.2, 2 x USB Type-C, 3 x USB 3.2, HDMI và LAN (RJ45).',26090000,'Laptop Lenovo Gaming Legion 5 (R5)','36 Tháng',7,11,'2022-11-20 17:01:49.746000'),(550,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.kbrgrwj7p2a_Laptop%20HP%20EliteBook%20X360%201040%20G8?alt=media&token=4f0ee09a-9c1c-45bc-919e-765b7f005d96','Đẳng cấp và ấn tượng hơn bao giờ hết cùng laptop HP EliteBook X360 1040 G8 i7 (3G1H4PA) với thiết kế sang trọng, bản lề gập xoay 360 độ cùng khả năng vận hành và xử lý mọi tác vụ mạnh mẽ mang đến những trải nghiệm trọn vẹn, khó quên cho người dùng.Tính năng đặc biệt tạo nên nét riêng độc đáoLaptop HP EliteBook sở hữu các cạnh bo viền mềm mại cùng bản lề gập xoay linh hoạt 360 độ cho phép bạn sử dụng laptop thuận tiện trong việc chia sẻ thông tin với người đối diện mà không phải xoay chuyển hướng rườm rà.Biến đổi thành chiếc máy tính bảng nhanh chóng cùng màn hình cảm ứng và bút đi kèm, cho người dùng thoải mái sử dụng trong mọi tư thế, thỏa sức sáng tạo trong công việc.Đặc biệt, HP EliteBook X360 sở hữu màn hình chống nhìn trộm nhờ công nghệ HP Sure View đảm bảo an toàn cho thông tin của bạn khi làm việc nơi công cộng như trường học, trên máy bay,...An toàn hơn cùng bảo mật vân tay, giúp tiết kiệm tối đa thời gian mở máy nhanh chóng chỉ với một chạm và đảm bảo các dữ liệu trong máy không bị xâm phạm.Đặc biệt, máy được trang bị Camera IR hồng ngoại có khả năng nhận diện khuôn mặt nhờ công nghệ Windows Hello Face giúp bạn tiết kiệm tối ưu thời gian mở khóa.\n	',45990000,'Laptop HP EliteBook X360 1040 G8','36 Tháng',7,532,'2022-11-20 17:06:15.217000'),(564,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.qv25hl887ha_Laptop%20HP%20Gaming%20VICTUS%2016%20e0170AX?alt=media&token=87a9ecae-78d3-499d-bd5f-fa7607693ee8','Dòng Gaming Victus là một phiên bản lột xác hoàn toàn từ thiết kế đến hiệu năng của nhà HP. Chỉ với một mức giá tầm trung là bạn có thể sở hữu ngay chiếc laptop HP Gaming VICTUS 16 e0170AX R7 (4R0U7PA) chinh phục mọi tác vụ.Diện mạo ấn tượng, mang đậm chất thể thao.Phiên bản laptop HP Victus mang một thiết kế tối giản nhưng cũng không kém phần mạnh mẽ nhờ kết hợp với những đường nét góc cạnh tạo nên một tổng thể hiện đại, bắt mắt mà bạn không thể tìm thấy hay nhầm lẫn với bất kỳ dòng laptop gaming nào.Điểm nhấn của chiếc laptop này là logo Victus sáng bóng cùng chữ Victus được khắc song song khiến cho máy trở nên tinh tế, thu hút người dùng. Bởi vì là chiếc laptop gaming nên máy có trọng lượng khá nặng khoảng 2.46 kg, độ dày 23.5 mm, tuy nhiên bạn vẫn có thể bỏ vào balo và chiến game ở khắp mọi nơi.Thật ấn tượng với khe thoát nhiệt dài và rộng được đặt ngay cạnh trước mặt lưng của máy giúp máy luôn mát mẻ, hoạt động ổn định khi sử dụng với các tác vụ nặng nhờ khe tản nhiệt lớn, lượng nhiệt thoát ra nhiều hơn, nhanh hơn, ngăn chặn tình trạng nóng bàn phím hay chỗ kê tay khi làm việc.Do màn hình lớn 16.1 inch được thiết kế khá nặng và dày, còn phần bản lề thì chưa được cứng cáp để giữ cho màn hình không bị rung lắc. Đây chính là điểm yếu nhất của chiếc máy này khi thao tác mạnh.Bạn có thể thao tác trên bàn phím chuẩn xác hơn nhờ đèn đơn sắc trắng được cài đặt dưới các phím. Hành trình phím sâu, khoảng cách giữa các phím vừa phải tạo sự thoải mái khi bạn thực hiện các lệnh. Bàn phím được thiết kế Fullsize giúp bạn tính toán, nhập liệu chỉ trong tích tắc.Cùng với đó, nhà laptop HP đã trang bị khá đầy đủ các cổng kết nối như cổng USB, Type-C, HDMI, Jack tai nghe và cả khe đọc thẻ nhớ SD hỗ trợ bạn kết nối các thiết bị ngoại vi như loa, màn hình, máy in,... dễ dàng hơn, tiện lợi hơn, truy xuất dữ liệu nhanh hơn.\n	',25490000,'Laptop HP Gaming VICTUS 16 e0170AX','36 Tháng',7,532,'2022-11-20 17:11:22.662000'),(574,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.okv04bqk1ca_Laptop%20Acer%20Swift%20X%20SFX16%2051G%20516Q?alt=media&token=7fe6f2f4-fae6-434a-ab30-045370a724f8','Nếu bạn đang tìm một chiếc laptop đồ hoạ - kỹ thuật với hiệu năng mạnh mẽ cùng thiết kế hiện đại thì laptop Acer Swift X SFX16 51G 516Q i5 (NX.AYKSV.002 ) là sản phẩm xứng đáng để bạn lựa chọn.Laptop Acer mang một hiệu năng mạnh mẽ, xử lý mượt mà các tác vụ thiết kế đồ hoạ, render video,... trên các phần mềm Photoshop, AI, Premiere,... hay thỏa sức cho bạn sáng tạo nội dung nhờ chip Intel Core i5 Tiger Lake 11320H cùng card rời NVIDIA GeForce RTX 3050 4 GB.Laptop RAM 16 GB và SSD 512 GB cho đa nhiệm ấn tượng, khởi động máy hay mở các ứng dụng nặng nhanh chóng, rút ngắn thời gian phản hồi, tối ưu hiệu suất cho máy.Màn hình trang bị kích thước 16.1 inch kết hợp với công nghệ IPS và Acer ComfyView cho khả năng chống chói tốt, chống ánh sáng xanh, bảo vệ tốt thị giác và sức khỏe của bạn, đồng thời mang đến góc nhìn được mở rộng, hiển thị rõ nét, chân thật.Công nghệ LED Backlit và TFT cho màn hình mỏng hơn, màu sắc tươi sáng, độ tương phản tốt, toả nhiệt ít, tiết kiệm điện năng cho máy.Bộ đôi công nghệ Acer TrueHarmony và DTS Audio cho âm thanh vòm đa chiều, ít bị biến dạng giúp âm thanh to rõ, chân thực, trải nghiệm giải trí thêm phần thú vị.Laptop Acer Swift có trọng lượng 1.9 kg và dày 18.9 mm cùng lớp vỏ kim loại cứng cáp, tạo nên tổng thể hiện đại, sang trọng phù hợp mọi không gian thiết kế, dễ dàng mang đi khắp nơi.Laptop được trang bị đèn nền dưới các phím hỗ trợ bạn nhập liệu nhanh chóng, chính xác trong bóng tối. Tích hợp tính năng cảm biến vân tay mở máy nhanh chóng chỉ với một chạm và thông tin cá nhân được đảm bảo an toàn. Đa dạng cổng kết nối được sở hữu 2 cổng USB 3.2, HDMI, Thunderbolt 4 USB-C truyền tải dữ liệu dễ dàng, tiết kiệm thời gian chờ.\n	',26090000,'Laptop Acer Swift X SFX16 51G 516Q','36 Tháng',7,10,'2022-11-20 17:15:04.290000'),(589,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.a53slgx143f_Laptop%20Dell%20Gaming%20G15%205511?alt=media&token=9a1cdc68-c14f-4a7f-a89f-e27940a82127','Không những mang đến cho người dùng hiệu năng ấn tượng nhờ con chip Intel thế hệ 11 tân tiến, laptop Dell Gaming G15 5511 i5 11400H (70266676) còn sở hữu thiết kế thời thượng, lôi cuốn, hứa hẹn sẽ là người cộng sự lý tưởng cùng bạn chinh phục mọi chiến trường.Thu hút mọi ánh nhìn cùng vẻ ngoài nổi bật.Đến với chiếc laptop, ngôn ngữ thiết kế đã được thay đổi so với các phiên bản tiền nhiệm, hầm hố hơn, các đường nét cắt xẻ tăng thêm phần gaming cho chiếc máy. Lớp vỏ nhựa màu xám bao bọc bên ngoài chiếc laptop Dell Gaming này mang đến sự bền bỉ hoàn mỹ cùng trọng lượng 2.81 kg và dày 25 mm, với mình đây là một con số vừa đủ để có thể mang theo bên người, phục vụ cho nhu cầu làm việc cũng như giải trí cho bản thân. \n	Đèn nền tiện lợi cùng các phím gõ sâu, độ nảy tốt được trang bị ở chiếc laptop Dell này hỗ trợ người dùng tối đa trong quá trình học tập, làm việc cũng như chơi các tựa game mà không lo nhầm lẫn, nâng cao hiệu suất làm việc dù ở bất kỳ điều kiện ánh sáng nào.Phiên bản laptop này còn được trang bị hàng loạt những cổng giao tiếp thông dụng dọc hai bên máy như USB 3.2, HDMI, Jack tai nghe 3.5 mm, LAN (RJ45) và USB Type-C, cho phép bạn kết nối hay truyền xuất dữ liệu đến nhiều loại thiết bị ngoại vi tương thích một cách dễ dàng hơn. Nhà Dell đã tâm lý khi mang những cổng kết nối về phía sau máy, giúp mình không bị vướng víu khi vừa làm việc trên máy vừa phải cắm sạc.Chiến mọi tựa game đình đám mượt mà.Bộ vi xử lý Intel Core i5 Tiger Lake đã mang lại hiệu năng tốt, tuy nhiên chiếc máy khi trải nghiệm tựa game Cyberpunk thì đã hơi “đuối” nếu để mức cài đặt cao nhất. Mình khuyến khích các bạn hãy hạ mức đồ hoạ của game xuống thấp để có trải nghiệm tốt hơn nhé. Đến với tựa game CS:GO, máy đã ổn định hơn với mức FPS là 90. Qua trải nghiệm chơi game, các thao tác như di chuột, qua lại đều rất trơn tru, cảm giác chơi game vẫn phấn khích, ấn tượng trong khi mức cài đặt của mình luôn để cao hoặc tối đa.Cho phép bạn mở cùng lúc nhiều ứng dụng, hàng loạt tab và chuyển đổi qua lại mà không lo giật lag nhờ sự đa nhiệm đến từ laptop RAM 8 GB chuẩn DDR4 2 khe (1 khe 8 GB + 1 khe rời). Tuy nhiên các tác vụ dó chỉ dừng lại ở mức cơ bản, nên để có thể khai thác tốt sức mạnh của CPU và GPU thì mình khuyên các bạn hãy nâng cấp thêm RAM nhé.Cùng bạn tạo nên những tác phẩm ấn tượng với chất lượng đồ họa vượt trội, hình ảnh chân thật nhờ card đồ họa rời NVIDIA GeForce RTX 3050 4 GB, cho bạn thỏa sức chỉnh sửa hình ảnh, render video,... chuyên nghiệp trên Photoshop, AI,... đồng thời mang đến trải nghiệm các tựa game một cách trơn tru ở cả mức đồ họa thấp hay cao như PUBG: Battlegrounds, LOL,...Chiếc máy được mình thử thách kiểm tra qua phần mềm Intel Processor Diagnostic Tool, qua đó nhận thấy mức xung nhịp tăng lên đến 3.15 Ghz so với thông số cơ bản mà hãng cung cấp là 2.7 Ghz. Đến với khả năng test GPU, mình chọn phần mềm Fur Mark để kiểm tra thì kết quả cho thấy máy sẽ xử lý loanh quanh 33 FPS. Đây là mức điểm chấp nhận được với chiếc máy gaming giá rẻ. Như mình đã nói, để khai thác hết sức mạnh của card màn hình thì các bạn hãy nâng cấp RAM để có trải nghiệm tốt nhất nha.Ổ cứng SSD 256 GB mang lại không gian lưu trữ thấp, với nhu cầu sử dụng hằng ngày của mình ở mức đơn giản, mình khuyên các bạn hãy nâng cấp SSD để mở rộng khả năng lưu trữ, cài game, ứng dụng thoả thích mà không lo phải giải phóng.Chuẩn xác hơn cả về hình ảnh lẫn âm thanh.Màn hình viền mỏng 15.6 inch sở hữu độ phân giải Full HD (1920 x 1080) cho hình ảnh hiển thị rõ nét, chân thật hơn ở những nơi có điều kiện ánh sáng bình thường như trong nhà, phòng học,... đồng thời mở rộng không gian đến 178 độ nhờ công nghệ WVA kết hợp cùng độ sáng 250 nits, mang đến những trải nghiệm trọn vẹn hơn. Theo mình màn hình máy sẽ đáp ứng tốt nhu cầu giải trí cơ bản như xem phim, chơi game nhẹ nhàng.Màn hình laptop 120 Hz cho bạn mãn nhãn với từng chuyển động của những bộ phim hành động đầy kịch tính hay các tựa game rượt đuổi hấp dẫn mà không lo xảy ra tình trạng giật, xé hình, kết hợp cùng công nghệ chống chói Anti Glare, hỗ trợ bạn giải trí ở cả điều kiện ánh sáng bất lợi mà không sợ ảnh hưởng tiêu cực đến mắt nhưng vẫn tiết kiệm điện năng tối ưu nhờ công nghệ LED Backlit.Âm thanh to rõ cùng khả năng khử tiếng ồn tân tiến đến từ công nghệ Nahimic Audio, cho bạn những trải nghiệm khó quên với không gian âm nhạc đặc sắc, sống động, mang đến cảm giác thư giãn hơn bao giờ hết.Dell Gaming G15 5511 i5 11400H (70266676) là phiên bản laptop gaming mà các game thủ nên cân nhắc chọn mua bởi cấu hình mạnh mẽ cùng kiểu dáng hiện đại. Bên cạnh đó thì Dell đã mang đến một sản phẩm gaming có mức giá dễ tiếp cận hơn với người dùng nên đây vẫn có thể là sự lựa chọn lý tưởng cho những ai có nhu cầu về đồ họa - kỹ thuật.\n',23890000,'Laptop Dell Gaming G15 5511','36 Tháng',7,588,'2022-11-20 17:23:09.388000'),(602,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.k99ckptoh9l_Laptop%20Dell%20Gaming%20Alienware%20m15%20R6?alt=media&token=62f2a501-28cb-43d9-abd9-371bbe215b01','Với phong cách thiết kế độc đáo cùng cấu hình vượt trội, laptop Dell Gaming Alienware m15 R6 i7 11800H (70272633) sẵn sàng đáp ứng hoàn hảo mọi tác vụ của một chiếc laptop đồ họa - kỹ thuật như thiết kế hay chiến game. Laptop Dell Gaming Alienware sở hữu CPU Intel Core i7 Tiger Lake 11800H mang lại hiệu năng xử lý vượt trội. Cùng bạn thoả sức sáng tạo hình ảnh, video với card tích hợp NVIDIA GeForce RTX 3070 8 GB hay giải trí với các tựa game hấp dẫn như CS:GO, GTAV,... Bộ nhớ RAM 32 GB cho khả năng đa nhiệm cực mượt mà, ổ cứng SSD 1 TB cho bạn thoải mái lưu trữ dữ liệu với khả năng truy xuất, khởi động máy cực nhanh. Laptop Dell sở hữu ngoại hình độc đáo mang lại độ nhận diện cao với chiếc logo nổi bật trên lớp vỏ nhựa bền chắc, trọng lượng 2.69 kg luôn trong tư thế sẵn sàng chiến đấu bất cứ khi nào bạn cần. Màn hình 15.6 inch có độ sáng lên đến 400 nits và 99% DCI-P3 cho hình ảnh hiển thị sống động, rực rỡ với độ tương phản cao. Công nghệ WVA mang đến cho màn hình laptop góc nhìn rộng lên đến 178 độ, tần số quét 240 Hz cho độ trễ cực thấp, mang lại trải nghiệm hình ảnh siêu mượt mà, không bị giật, xé khi chiến những trận game đỉnh cao. Đèn bàn phím chuyển màu RGB độc đáo hỗ trợ bạn gõ tốt, chiến game trong mọi điều kiện sáng. Trang bị các cổng kết nối tiện lợi như USB 3.2, HDMI, LAN (RJ45), USB Type-C. Công nghệ High Definition (HD) với tính năng khuếch đại âm thanh cùng Audio Nahimic Audio giả lập hệ thống âm vòm 3D sống động, lọc và khử tiếng ồn hiệu quả.',60490000,'Laptop Dell Gaming Alienware m15 R6','36 Tháng',7,588,'2022-11-20 17:30:08.498000'),(611,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.hdjyoxffh95_Laptop%20MacBook%20Pro%2014%20M1%20Max%202021?alt=media&token=72d6eb6e-37b6-47bd-a6eb-9682b6424fb0','Khoác lên mình vẻ ngoài mới lạ so với các dòng Mac trước đó, thiết kế màn hình tai thỏ ấn tượng, bắt mắt cùng bộ hiệu năng đỉnh cao M1 Max mạnh mẽ, MacBook Pro 14 inch M1 Max 2021 xứng tầm là chiếc laptop cao cấp chuyên dụng dành cho dân kỹ thuật - đồ họa, sáng tạo nội dung.Cấu hình \"khủng\", đa nhiệm mượt mà mọi tác vụ nặng.Sức mạnh hiệu năng siêu cấp, đỉnh cao đến từ con chip Apple M1 Max mang cấu trúc 10 nhân cho tốc độ băng trong lên đến 400 GB/s memory bandwidth nhanh hơn khoảng 70% so với thế hệ tiền nhiệm Apple M1, cung cấp tốc độ xử lý đáng kinh ngạc, giải quyết tối ưu mọi công việc văn phòng như soạn thảo hợp đồng, văn bản trên các phần mềm Word, nhập liệu hay thống kế trên Excel,... đến thiết kế đồ họa, posters, banners, sáng tạo nội dung chuyên nghiệp bằng các công cụ Figma, Photoshop, AI, Pr, AutoCAD,...Card đồ họa tích hợp GPU 24 nhân được trang bị trong chiếc Macbook Pro nâng cao hiệu suất đồ họa gấp 4 lần so với M1, cho bạn tự do thiết kế các tác phẩm tâm đắc, thoả sức sáng tạo với những nội dung mới, dựng clip, render video cũng ấn tượng không kém mà vẫn tiết kiệm điện năng đáng kể.Laptop RAM 32 GB tăng tốc độ độc ghi, truy xuất dữ liệu, mọi thao tác được phản hồi tức thời, khả năng đa nhiệm cực mượt mà cho bạn dễ dàng vừa làm việc hiệu quả trên các phần mềm thiết kế để chỉnh sửa hình ảnh, render video cùng lúc.Ổ cứng SSD 512 GB cung cấp dung lượng vừa đủ để bạn lưu trữ dữ liệu cá nhân, tệp hình ảnh, video của bản thân và các bộ phim, bản nhạc yêu thích, đồng thời mở video 8K ngay lập tức hoặc lưu trữ hàng trăm ảnh RAW cùng một lúc.	Hệ điều hành Mac OS với giao diện máy tính có độ thẩm mỹ cao, hiện đại, thuận tiện mang lại cảm hứng làm việc ngay mỗi khi bạn bật máy lên, tiện thao tác, dễ sử dụng và kho ứng dụng đồ sộ.',72700000,'Laptop MacBook Pro 14 M1 Max 2021','12 Tháng',7,15,'2022-11-20 17:34:33.165000'),(626,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.juqljoongia_Laptop%20MSI%20Katana%20Gaming%20GF66%2011UC?alt=media&token=2654165e-c201-44d3-a7da-5a62a5283265','Laptop MSI Katana GF66 11UC i7 (224VN) mang vẻ ngoài cơ động cùng cấu hình mạnh mẽ, đẩy nhanh quá trình xử lý mọi tác vụ hay sẵn sàng đồng hành cùng bạn chiến mọi thể loại game đầy kịch tính. Phát huy sức mạnh hiệu năng với chip Intel Gen 11. Hiệu năng được nâng cấp tối đa lên đến 40% so với các thế hệ tiền nhiệm nhờ bộ vi xử lý Intel Core i7 Tiger Lake 11800H sở hữu 8 nhân 16 luồng cùng xung nhịp tốc độ tối đa đến 4.6 GHz phát huy hiệu suất tối ưu trong xử lý công việc hay thoải mái chơi mọi trận game cực chất sau những giờ làm việc căng thẳng. Laptop RAM 8 GB loại DDR4 2 khe có tốc độ Bus RAM 3200 MHz giúp laptop đa nhiệm mượt mà hơn trong mọi tác vụ, hỗ trợ mở nhiều ứng dụng mà không lo giật lag máy. Đặc biệt, MSI Katana được hỗ trợ 1 khe RAM trống để bạn dễ dàng nâng cấp RAM đến 64 GB mà không phải thay thế thanh RAM cũ đáp ứng thêm nhu cầu của bạn.Khả năng đồ họa vượt bật cùng card rời NVIDIA GeForce RTX 3050 sở hữu bộ nhớ đệm 4 GB, đáp ứng hầu hết các nhu cầu thiết kế 2D, 3D, chỉnh sửa video,... hay thỏa mãn người dùng với các tựa game hấp dẫn như Far Cry 5, Liên Minh Huyền Thoại, FIFA, GTA V, Apex Legends... ở mức cài đặt cao.Tiết kiệm tối đa thời gian mở và vận hành máy nhờ ổ cứng SSD 512 GB NVMe PCle giúp bạn khởi động game một cách nhanh chóng, đồng thời cung cấp không gian đủ lớn để bạn thoải mái lưu trữ các tựa game hay tệp đồ họa nặng. Ngoại hình cá tính đầy nổi bật.Phiên bản laptop MSI này được thiết kế nắp lưng nhựa bền bỉ với tông màu chủ đạo đen nhám cùng các cạnh có đường cắt nét gọt mạnh mẽ làm tôn lên vẻ cá tính cho người sở hữu.Máy sở hữu trọng lượng 2.1 kg và dày 24.9 mm đem đến sự tiện lợi trong quá trình di chuyển, thể hiện tính di động đối với một chiếc laptop gaming.\n	',23590000,'Laptop MSI Katana Gaming GF66 11UC','36 Tháng',7,14,'2022-11-20 17:38:21.335000'),(662,_binary '\0','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.olticogzs3_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20Samsung%20Galaxy%20Z%20Flip4%20128GB?alt=media&token=8278a3b0-60c7-4f3d-b64a-9f3a8cb56c97','Có lẽ điện thoại gập đã không còn là cái tên quá xa lạ bởi nhiều ông lớn trong ngành sản xuất điện thoại đã cho ra mắt các sản phẩm có thiết kế tương tự, gần đây nhất thì có sự góp mặt của chiếc flagship đến từ nhà Samsung mang tên Galaxy Z Flip4. Ngay từ những giây phút đầu tiên sử dụng chiếc Galaxy Z Flip4 mình đã cảm nhận được sự khác biệt của nó so với thế hệ trước, máy bây giờ đã vuông vắn hơn nhờ tạo hình vát phẳng ở hai mặt và các cạnh.Phần mặt lưng của máy được phủ một lớp nhám nhẹ giúp cho mình có thể cầm nắm chắc tay hơn, hạn chế được tình trạng bám dấu vân tay trong quá trình sử dụng.',20990000,'Điện thoại Samsung Galaxy Z Flip4 128GB','24 Tháng',9,639,'2022-11-20 18:30:37.558000'),(669,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.fx0fp9m6j67_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20iPhone%2011%20?alt=media&token=9c37f1a3-5117-4463-89b2-bb7cb31ba1ea','Sau khi iPhone 11 thậm chí còn rẻ hơn cả XR khi ra mắt - rẻ hơn khoảng 1 triệu đồng. Tin tốt là vẫn được trang bị những thứ cao cấp nhất và có một số bổ sung đáng đồng tiền cho chiếc iPhone giá rẻ trong bộ 3 iPhone 11 sereise .iPhone 11 hoàn toàn giữ nguyên kiểu dáng và màn hình giống như iPhone XR. Nó sử dụng cùng một màn hình IPS LCD 6,1 \"với 326ppi và tai thỏ ở trên chứa công nghệ Face ID. Các thông số kỹ thuật của màn hình không thay đổi - cùng độ tương phản, độ sáng, Haptic Touch và không thay đổi.\nIPhone 11 tự hào có chip Apple A13 Bionic mới - cùng một SoC cung cấp năng lượng cho bộ đôi iPhone 11 Pro hàng đầu. Nó cũng có camera thứ hai và đó là camera góc siêu rộng 12MP mới, cũng được mang từ các mẫu Pro. Các tính năng như Crop Out of Frame cũng có sẵn và cũng có thể quay video 4K bằng tất cả các máy ảnh cùng một lúc.',11990000,'Điện thoại iPhone 11 ','24 Tháng',9,640,'2022-11-20 18:35:47.257000'),(682,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.m3kzokwlx6_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20iPhone%2013%20Pro%20Max?alt=media&token=5a2ae4dd-db59-46f0-ba9e-32974826d46b','Apple đã chính thức ra mắt dòng iPhone 2021 với tên gọi iPhone 13 Series. Trong đó iPhone 13 Pro Max là phiên bản cao cấp nhất với màn hình lớn, tốc độ làm tươi 120Hz và dung lượng lưu trữ lên tới 1TB.Thiết kế vuông vức sang trọng, tần số quét lên tới 120Hz.Xét về phong cách thiết kế, iPhone 13 Pro Max vẫn sở hữu khung viền vuông vức bằng kim loại sang trọng tương tự như iPhone 12 Pro Max. Mặt lưng của máy được hoàn thiện nhám để tránh lưu lại vân tay khi sử dụng. Cầm chiếc iPhone 13 Pro Max trên tay chắc chắn sẽ thu hút mọi ánh nhìn bởi thiết kế quá ấn tượng.Là chiếc iPhone lớn nhất nên màn hình của iPhone 13 Pro Max cũng có kích thước lên tới 6.7 inch. Trên màn hình vẫn có tai thỏ quen thuộc nhưng đã được tinh chỉnh nhỏ gọn hơn thế hệ trước 20% nhằm tối ưu hóa không gian hiển thị. Camera selfie 12MP nằm trong tai thỏ và cung cấp bảo mật Face ID. Màn hình vẫn được bảo vệ bởi kính cường lực Ceramic Shield siêu bền.Apple đã trang bị màn hình Super Retina XDR với công nghệ ProMotion giúp tinh chỉnh tần số quét 10 - 120Hz. Độ sáng tối đa cũng đã được tăng lên 1.200 nits. Có thể nói đây là điểm sáng giá nhất của iPhone 13 Pro Max.',27490000,'Điện thoại iPhone 13 Pro Max','24 Tháng',9,640,'2022-11-20 18:39:00.106000'),(697,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.imjpb9pi8kp_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20iPhone%2013%20Pro%20?alt=media&token=3d433bcf-f65a-4f3e-b024-1fb2e7087c36','Vốn là một thương hiệu hướng đến sự tinh tế, đẳng cấp nên thiết kế của sản phẩm nhà Apple rất được trau chuốt kỹ lưỡng. Thế hệ iPhone 13 Series năm nay cũng không ngoại lệ. Chúng vẫn sở hữu kiểu dáng vuông vắn, mạnh mẽ và cho cảm giác cầm nắm chắc tay như thế hệ tiền nhiệm là iPhone 12. Tuy nhiên, iPhone mới sẽ có độ dày tăng thêm khoảng 0,26 mm và nặng hơn vì sở hữu viên pin lớn hơnCả 2 mặt kính cả trước và sau của iPhone 13 Pro đều được tăng cường độ bền bởi chất liệu Ceramic Shield, không chỉ hạn chế chống xước gấp 4 lần mà còn toát lên sự sang trọng, đầm tay.Về phần notch năm nay sẽ được thu gọn lại 20%, giúp tăng diện tích màn hình. Apple đã di chuyển vị trí loa lên cạnh trên của notch thay vì ngay ở giữa, còn bộ thu của máy ảnh TrueDepth cũng được di chuyển sang cạnh để “tai thỏ nhỏ “ lại.',25490000,'Điện thoại iPhone 13 Pro ','24 Tháng',9,640,'2022-11-20 18:41:50.061000'),(712,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.qjzqclcvch_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20iPhone%2013%20?alt=media&token=0c473c1f-603d-42b8-9558-bda6d7fbcf6f','Với những cải tiến không ngừng nghỉ cho những sản phẩm điện thoại thông minh của mình, Apple là hãng smartphone luôn nhận được sự tin tưởng từ người tiêu dùng Việt Nam. Dòng sản phẩm iPhone 13 được ra mắt gần đây với màu sắc mới và nâng cấp đáng kể về phần cứng của điện thoại đang nhận được rất nhiều sự quan tâm từ người hâm mộ.Theo thông báo từ phía Apple, iPhone 13 năm nay sẽ có kích thước màn hình 6.1 inch. Nhìn chung, ngôn ngữ thiết kế vẫn sẽ không có quá nhiều thay đổi so với thế hệ tiền nhiệm iPhone 12, vẫn là các cạnh vát phẳng vuông góc. Tuy nhiên, hãng đã rút gọn phần notch nhỏ hơn 20%, để tăng thêm diện tích hiển thị cho người dùng. Mặt trước làm từ kính cường lực Ceramic Shield có độ bền hơn tới 4 lần so với kính cường lực thông thường. iPhone 13 năm nay được trang bị tấm nền Super Retina XDR OLED sáng hơn 28% so với năm ngoái, đạt tối đa 1200 nits khi hiển thị các video và ảnh HDR. Với sự trang bị này bạn có thể trải nghiệm đa tác vụ từ học tập, làm việc cho tới giải trí tối ưu.',19690000,'Điện thoại iPhone 13 ','24 Tháng',9,640,'2022-11-20 18:44:45.855000'),(729,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.zu4opt1p7eo_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20iPhone%2014%20?alt=media&token=501ea4b0-a390-4eb7-9041-cc45b6f8c973','iPhone 14 vẫn giữ lại cho mình vẻ đẹp nguyên bản khi thừa hưởng kiểu dáng thiết kế quen thuộc đến từ các thế hệ trước tiêu biểu như iPhone 13, hai mặt và cạnh được vát phẳng cùng 4 góc bo cong tinh tế.Mặt sau của điện thoại iPhone sẽ là mặt lưng kính cao cấp và bộ khung nhôm, không chỉ giúp máy có được vẻ ngoài sang trọng hơn mà hai loại vật liệu này còn giúp cho iPhone 14 có thêm độ bền bỉ để bạn có thể sử dụng thiết bị dài lâu hơn.Mặt sau của điện thoại iPhone sẽ là mặt lưng kính cao cấp và bộ khung nhôm, không chỉ giúp máy có được vẻ ngoài sang trọng hơn mà hai loại vật liệu này còn giúp cho iPhone 14 có thêm độ bền bỉ để bạn có thể sử dụng thiết bị dài lâu hơn.Mặt trước sẽ được Apple phủ lên trên một lớp kính cường lực Ceramic shield để đem khả năng hạn chế trầy xước, giúp cho chiếc điện thoại của bạn luôn mới.\n',27490000,'Điện thoại iPhone 14 ','24 Tháng',9,640,'2022-11-20 18:47:37.435000'),(738,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.476duibillp_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20iPhone%2014%20Pro?alt=media&token=fe365673-a4e7-44eb-b6e6-b1083e447fc5','Phong cách thiết kế dẫn đầu xu thế thường thấy trên các phiên bản như iPhone 13 series vẫn được Apple áp dụng trên dòng sản phẩm mới của mình, iPhone 14 Pro vẫn sở hữu cạnh viền vát phẳng đang là trend ở thời điểm hiện tại cùng cụm camera mang những nét đặc trưng riêng,\n tạo sự hoàn hảo trong từng đường nét.Màn hình OLED kích thước 6.1 inch cùng độ phân giải 2556 x 1179 Pixels mang đến cho người dùng một không gian hiển thị siêu rõ nét đến từng chi tiết, màu sắc được thể hiện chân thực với độ chính xác màu cao, tạo trải nghiệm xem hoàn hảo.\n',40490000,'Điện thoại iPhone 14 Pro','24 Tháng',9,640,'2022-11-20 18:50:36.069000'),(750,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.hms1dpua3hq_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20iPhone%2014%20Plus?alt=media&token=e6e6f935-b98b-47eb-a3dd-043f22d39454','Được chế tác với kiểu tương tự như thế hệ tiền nhiệm iPhone 13, tinh tế theo từng đường nét với khung nhôm chắc chắn, mặt trước và sau được trang bị kính cường lực vừa tăng tính thẩm mỹ vừa tăng độ cho thiết bị .Màu sắc luôn được thay đổi mới ở iPhone thế hệ, mỗi dòng thường sẽ có 1 đặc biệt màu ghi riêng. iPhone 14 năm nay sẽ có 5 màu với tông màu nhẹ nhàng như: Đen, trắng, xanh dương, tím nhạt và đỏ.Các màu đều mang một phong cách trẻ trung, phù hợp với hầu hết mọi phong cách người dùng.',27490000,'Điện thoại iPhone 14 Plus','24 Tháng',9,640,'2022-11-20 18:53:17.977000'),(759,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.qxfmi0mesc_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20iPhone%2014%20Pro%20Max?alt=media&token=73a99663-a82d-40b1-866c-3fab96fb23b0','Sản phẩm có trong mình một diện mạo bắt mắt nhờ lối tạo hình vuông vức bắt trend tương tự thế hệ iPhone 13 series,đây được xem là kiểu thiết kế rất thành công trên các đời thế hệ trước khi tạo nên cơn sốt toàn cầu về kiểu dáng thiết kế điện thoại cho đến nay. Mặt lưng làm từ kính cùng khung thép không gỉ giúp cho iPhone có thêm độ bền bỉ để đồng hành cùng bạn được lâu dài hơn, không những thế nó còn làm cho thiết bị của bạn trở nên sang trọng và đẳng cấp hơn.',33990000,'Điện thoại iPhone 14 Pro Max','24 Tháng',9,640,'2022-11-20 19:01:18.459000'),(771,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.p4nid4evgde_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20iPhone%2013%20Mini?alt=media&token=5b4210db-2982-454c-994b-98122897ff58','iPhone 13 mini được trang bị bộ vi xử lý A15 Bionic sản xuất trên tiến trình 5 nm giúp cải  thiện hiệu suất và giảm điện năng tiêu thụ đến 15% so với phiên bản A14 Bionic trước đó, đáp ứng hoàn hảo trong công việc cũng như trong giải trí của người dùng tốt hơn.CPU 6 lõi cho hiệu suất hoạt động tăng 40% cùng với đó là GPU cũng có mức hiệu năng tăng mạnh lên đến 80% so với chipset thế hệ trước. Bạn hoàn toàn có thể chơi game mượt mà, các thao tác chỉnh sửa hình ảnh, cắt ghép video đều vô cùng trơn tru. \n',17290000,'Điện thoại iPhone 13 Mini','24 Tháng',9,640,'2022-11-20 19:05:05.525000'),(789,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.kapobx6yl3c_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20iPhone%2012?alt=media&token=824be802-e985-4c8e-af15-2b89d01eef11','Apple đã trang bị con chip mới nhất của hãng (tính đến 11/2020) cho iPhone 12 đó là A14 Bionic, được sản xuất trên tiến trình 5 nm với hiệu suất ổn định hơn so với chip A13 được trang bị trên phiên bản tiền nhiệm iPhone 11.Chưa hết, Apple còn gây bất ngờ đến người dùng với hệ thống 5G lần đầu tiên được trang bị trên những chiếc iPhone, cho tốc độ truyền tải dữ liệu nhanh hơn, ổn định hơn.iPhone 12 sẽ chạy trên hệ điều hành iOS 15 (12/2021) với nhiều tính năng hấp dẫn như hỗ trợ Widget cũng như những nâng cấp tối ưu phần mềm đáng kể mang lại những trải nghiệm thú vị mới lạ đến người dùng.\n',16490000,'Điện thoại iPhone 12','24 Tháng',9,640,'2022-11-20 19:09:55.514000'),(807,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.ui9xvy4tics_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20Samsung%20Galaxy%20S22%20Ultra%205G?alt=media&token=f3d67493-1ffb-41d0-8085-25a5e010b009','Galaxy S22 Ultra 5G được kế thừa form thiết kế từ những dòng Note trước đây của hãng đem đến cho bạn có cảm giác vừa mới lạ vừa hoài niệm. Trọng lượng của máy 228 g cho cảm giác cầm nắm đầm tay, khi cầm máy trần thì hơi có cảm giác dễ trượt.Phần mặt lưng điện thoại được làm nhám nên hạn chế tốt việc bám dấu vân tay, có thiết kế cũng khá đơn giản nhưng vẫn toát lên vẻ sang trọng và cao cấp của chiếc máy. Cụm camera sau trên Galaxy S22 Ultra 5G được thiết kế trần tạo cảm giác gọn gàng và cũng tạo nên một điểm nhấn độc đáo cho chiếc máy.\n',25990000,'Điện thoại Samsung Galaxy S22 Ultra 5G','24 Tháng',9,639,'2022-11-20 19:13:39.229000'),(816,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.7rr086yro5a_%20%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20Samsung%20Galaxy%20Z%20Fold4?alt=media&token=5f131805-d1d5-403c-af5b-f46578514304','Năm nay Z Fold4 có thiết kế cân bằng hơn, bản lề và viền màn hình được thiết kế mỏng hơn giúp tổng thể ở màn hình phụ của máy rộng thêm 2.7 mm và màn hình chính rộng hơn 3 mm khi so với thế hệ tiền nhiệm. Tuy con số không quá lớn nhưng với trải nghiệm thực tế thì đây là một thay đổi cực kỳ đáng giá và mang lại hiệu quả sử dụng cao.Với kích thước màn hình được tăng lên thì màn hình phụ của Fold4 đã dễ dàng thao tác và gõ văn bản hơn, không còn gặp tình trạng dính chữ như trên thế hệ trước nữa',37990000,'Điện thoại Samsung Galaxy Z Fold4','24 Tháng',9,639,'2022-11-20 19:19:05.884000'),(826,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.4ojof0nw1xt_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20Samsung%20Galaxy%20Z%20Fold3?alt=media&token=5c140908-25ff-4fdb-a59e-4cabfe5b25c3','Có thể thấy mẫu smartphone Galaxy Z Fold3 lần này vẫn giữ nguyên ngoại hình cùng cơ chế màn hình gập mở dạng quyển sách như của tiền nhiệm, \"hô biến\" chiếc smartphone thành một chiếc máy tính bảng mini một cách dễ dàng và ngược lại.Khung viền sử dụng hợp kim nhôm Armor Aluminum cứng cáp, bền bỉ hơn 10% so với các vật liệu trước đây Samsung từng sản xuất. Với cấu tạo chắc chắn sẽ giúp bạn yên tâm tận hưởng các hoạt động yêu thích một cách trọn vẹn nhất.\n',31990000,'Điện thoại Samsung Galaxy Z Fold3','24 Tháng',9,639,'2022-11-20 19:26:14.252000'),(838,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.umynlwbeta_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20Samsung%20Galaxy%20M53%20?alt=media&token=a9eac601-abb0-4f23-8b52-e9c17259f7f2','Samsung đã trình làng Galaxy M53 với ba phiên bản màu vô cùng đẹp mắt như mình đang cầm trên tay, với tone màu có hơi sẫm đi một tí làm toát lên một vẻ huyền bí đầy cuốn hút và thanh lịch.Galaxy M53 được bao bọc bởi một bộ khung kim loại chắc chắn, giúp máy trở nên bền bỉ hơn trong quá trình sử dụng cũng như toát lên một vẻ nhìn cao cấp.Bên cạnh đó Samsung cũng đã gia công phần khung này có hơi cong đi một chút, giúp quá trình cầm nắm sử dụng trở nên dễ chịu hơn hẳn, được xem là một điểm mà mình rất là ưng.',11190000,'Điện thoại Samsung Galaxy M53 ','24 Tháng',9,639,'2022-11-20 19:29:11.533000'),(845,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.1ixpwfbu5fo_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20Samsung%20Galaxy%20A73%205G%20Awesome%20Edition?alt=media&token=f18fe09d-1ad3-4a47-9677-b004c6cbeb0d','Nhìn chung ngoại hình của máy không quá khác biệt so với người anh em tiền nhiệm của mình Galaxy A52s 5G, mặt lưng được hãng hoàn thiện từ nhựa nhám hạn chế tối đa được vân tay và mồ hôi trong quá trình sử dụng.Khung của A73 được làm từ nhựa với hiệu ứng giả kim sáng bóng, mang đến một cái nhìn sang trọng hơn. Cụm camera sau được Samsung thiết kế kiểu “hiệu ứng nổi 3D”, mang đến sự liền mạch trong thiết kế giữa camera và mặt lưng.',11090000,'Điện thoại Samsung Galaxy A73 5G Awesome Edition','24 Tháng',9,639,'2022-11-20 19:39:35.360000'),(854,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.ddvjhkvk5n_%C4%90i%E1%BB%87n%20tho%E1%BA%A1i%20Samsung%20Galaxy%20A73%205G?alt=media&token=e2a9cf12-771a-47a6-9c7a-cac26ee3c2c9','Samsung Galaxy A73 5G 128GB được xem là sản phẩm nổi bật nhất dòng Galaxy A 2022 mới ra mắt, máy trang bị bộ thông số kỹ thuật ấn tượng về phần hiệu năng, chất lượng màn hình và nổi bật nhất trong số đó là camera khi nó đem lại bức ảnh có độ phâ