asestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.bb5705nder_B%C3%A0n%20Ph%C3%ADm%20Kh%C3%B4ng%20D%C3%A2y%20Touchpad%20Rapoo%20K2800?alt=media&token=4df43ff2-02b0-4c1e-aad9-50d43c286f28','Bàn phím Rapoo không dây gọn kích thước gọn gàng, các cạnh bo viền mềm mại, phím bấm vuông vức tinh tế chất liệu nhựa bền tốt với chữ in laser nổi bật, không bị làm mờ khi sử dụng trong thời gian dài. Thiết kế bảo vệ an toàn tối ưu cho các bo mạch, không lo hư hại trong các tình huống vô tình làm tràn nước, để bạn thoải mái vừa làm việc vừa thưởng thức cà phê hay các thức uống yêu thích.',500000,'Bàn Phím Không Dây Touchpad Rapoo K2800','12 Tháng',8,1142,'2022-11-27 17:04:20.346000'),(1315,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.xfyrr7yt2ja_B%E1%BB%99%20B%C3%A0n%20Ph%C3%ADm%20Chu%E1%BB%99t%20Kh%C3%B4ng%20D%C3%A2y%20Zadez%20ZMK-530G?alt=media&token=37cbfa4f-056a-4b1c-b4b6-e2807d093fed','Bàn phím được chế tác với các phím tách rời, có thiết kế hình vuông nhỏ, cạnh thẳng và góc bo tròn, gam màu xám sang trọng như thỏi socola đẹp mắt, tạo điểm nhấn cho văn phòng làm việc thêm cao cấp hơn.',790000,'Bộ Bàn Phím Chuột Không Dây Zadez ZMK-530G','12 Tháng',8,1143,'2022-11-27 17:06:22.925000'),(1330,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.fi39hua3eh_B%C3%A0n%20Ph%C3%ADm%20C%C6%A1%20C%C3%B3%20D%C3%A2y%20Gaming%20Rapoo%20V500%20alloy%20%C4%90en?alt=media&token=6107fdb6-98be-4a91-9569-1364bee1562a','Rapoo V500alloy tiêu giản vùng phím số, trang bị 87 phím cơ bản đủ đáp ứng mọi nhu cầu trên 1 bàn phím làm việc, chơi game thông thường.Hành trình phím tốt với khoảng cách phím rộng, Switch Rapoo Blue êm ái, độ nảy và độ nhạy tốt cho thao tác nhấn phím nhanh cực mượt và chuẩn xác.Tuổi thọ Switch lên đến 60 triệu lượt nhấn phím, cho bạn an tâm sử dụng bàn phím liên tục suốt thời gian dài.',600000,'Bàn Phím Cơ Có Dây Gaming Rapoo V500 alloy Đen','12 Tháng',8,1142,'2022-11-27 17:08:25.580000'),(1338,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.g0a9iykjepu_B%C3%A0n%20Ph%C3%ADm%20Bluetooth%20Microsoft%20QSZ-00017%20%C4%90en?alt=media&token=1ba0a9af-78ee-4588-9a53-1d1894ab3d09','Bàn phím Bluetooth Microsoft QSZ-00017 đen có các góc cạnh được làm bo tròn cho thiết kế gọn đẹp, mềm mại, sắc đen thanh lịch, dễ dàng sắp đặt trên bàn làm việc, kệ tủ hay thậm chí là đặt trên chân bạn để sử dụng tiện lợi.Các phím bấm được in rõ ký hiệu đảm bảo người dùng thao tác và gõ chính xác, chắc chắn.',1490000,'Bàn Phím Bluetooth Microsoft QSZ-00017 Đen','12 Tháng',8,1144,'2022-11-27 17:10:27.124000'),(1343,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.ugmphz9pev_B%E1%BB%99%20b%C3%A0n%20ph%C3%ADm%20chu%E1%BB%99t%20kh%C3%B4ng%20d%C3%A2y%20Microsoft%20850%20%C4%91en?alt=media&token=b66d5c9e-44ff-4dbe-b742-14a39ae41ec0','Điểm nổi bật đầu tiên của bộ đôi bàn phím - chuột này là thiết kế không dây, kiểu dáng hiện đại, bàn phím rộng với các nút bấm có kích cỡ hợp lý cho bạn gõ phím bằng cả 2 tay thuận lợi. Thiết kế chuột cân đối, thích hợp cho người thuận cả tay trái và phải, mang đến sự tự do, thư thái trong từng thao tác khi trải nghiệm.Sắc màu đen sang trọng đồng nhất cho cả bàn phím và chuột máy tính phối hợp hoàn hảo với mọi màn hình, laptop.',750000,'Bộ bàn phím chuột không dây Microsoft 850 đen','12 Tháng',8,1144,'2022-11-27 17:12:18.201000'),(1348,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.g4z155x7llk_B%C3%A0n%20ph%C3%ADm%20kh%C3%B4ng%20d%C3%A2y%20Microsoft%20All-in-one%20Media%20N9Z-00028%20%C4%91en?alt=media&token=f157589e-e216-4742-98f6-5bc76d5edcc4','Bàn phím không dây Microsoft All-in-one Media N9Z-00028 đen trang bị đầy đủ các phím cơ bản để đáp ứng nhu cầu sử dụng của người dùng. Thiết kế phím bấm với độ nhạy cao, độ nảy tốt, phím êm, đảm bảo tính chuẩn xác trong từng thao tác điều khiển.Bên cạnh đó, các phím nóng được tích hợp để gia tăng trải nghiệm dùng, gồm nhóm phím điều chỉnh âm lượng media và nhóm phím nóng phương tiện truy cập nhanh vào nhạc, ảnh và video của bạn.',990000,'Bàn phím không dây Microsoft All-in-one Media N9Z-00028 đen','12 Tháng',8,1144,'2022-11-27 17:14:08.804000'),(1355,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.zf4lff3zof_B%C3%A0n%20Ph%C3%ADm%20C%C6%A1%20C%C3%B3%20D%C3%A2y%20Gaming%20Rapoo%20V500Pro%20V%C3%A0ng%20Xanh?alt=media&token=95c3e153-f495-4182-8930-4995938ced8b','Rapoo V500 Pro trang bị đầy đủ các phím bấm cơ bản với hành trình phím rất đỗi quen thuộc, dễ dàng để người dùng mới tiếp cận và làm quen ngay từ lần đầu sử dụng.Bàn phím cơ sử dụng switch treo cho độ nảy, độ đàn hồi và độ nhạy cực tốt, Switch Rapoo Blue tuổi thọ tốt lên đến 60 triệu lượt nhấn, đảm bảo bàn phím bền bỉ đồng hành cùng bạn trong suốt thời gian dài.Nhờ được trang bị hệ thống chống xung đột trên toàn bộ các phím, thật thoải mái để sử dụng cùng lúc nhiều phím, hoặc thao tác nhấn phím cực nhanh trên Rapoo V500 Pro mà không xảy ra hiện tượng xung đột tín hiệu, đảm bảo cho độ chuẩn xác trên từng lệnh thao tác.',990000,'Bàn Phím Cơ Có Dây Gaming Rapoo V500Pro Vàng Xanh','12 Tháng',8,1142,'2022-11-27 17:16:30.816000'),(1374,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.ae9wtqo477_B%C3%A0n%20Ph%C3%ADm%20Kh%C3%B4ng%20D%C3%A2y%20DareU%20EK87?alt=media&token=b309c90f-a894-478d-a429-bdccae49a351','DareU EK87 - chiếc bàn phím Tenkeyless 87 key đến từ nhà DareU, thiết kế từ kết hợp nhựa ABS cùng Blue switch mang lại âm thanh loại cực kỳ quan trọng. This bàn phím sở hữu tông màu trắng / hồng cực kỳ phù hợp với những khách hàng trẻ.',666000,'Bàn Phím Không Dây DareU EK87','12 Tháng',8,1145,'2022-11-27 17:18:19.085000'),(1392,_binary '','https://firebasestorage.googleapis.com/v0/b/graduation-396ec.appspot.com/o/product%2F0.5nauwq0meph_B%C3%A0n%20Ph%C3%ADm%20Bluetooth%20DareU%20EK868?alt=media&token=eacc6d3a-bdce-42b7-82e3-c30282b82e4f','DareU EK868 - Bàn phím bluetooth mẫu của hãng DareU, sở hữu thiết kế cứng cáp, màu sắc trẻ trung cùng keycap thiết kế theo kiểu độc đáo cấu hình thấp. Là key rút gọn kiểu 68, use Blue switch mang lại cảm giác nhẹ nhàng và âm thanh cực kỳ bắt tai. Cùng mình tìm hiểu cách sử dụng bàn phím này nhé!',1170000,'Bàn Phím Bluetooth DareU EK868','12 Tháng',8,1145,'2022-11-27 17:20:25.730000');
