/*!50003 SET sql_mode              = 'STRICT_TRANS_TABLES,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `REVENUE_STATISTICS_BY_YEAR`(IN years int)
BEGIN
    SELECT
        MONTH(recipient_date) ,
        YEAR(recipient_date),
        SUM(amount)
    FROM orders O INNER JOIN order_detail OD ON O.od_id = OD.odde_od_id
    WHERE status = 'DELIVERED'
      AND YEAR(recipient_date) = years
    GROUP BY MONTH(recipient_date);
END ;;
DELIMITER ;
