/*!50003 DROP PROCEDURE IF EXISTS `SHIPPER_STATISTICS_ORDER` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_0900_ai_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'STRICT_TRANS_TABLES,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SHIPPER_STATISTICS_ORDER`(IN userShipperId bigint, IN years int)
BEGIN
    SELECT
        MONTH(o.recipient_date) as months,
        YEAR(o.recipient_date) as years,
        sum(distinct case
             when (select sum(od.qty * price) from order_detail od where od.odde_od_id = o.od_id) > 10000000
                 and (select sum(od.qty * price) from order_detail od where od.odde_od_id = o.od_id) < 20000000
                 then 300000
             when (select sum(od.qty * price) from order_detail od where od.odde_od_id = o.od_id) >= 20000000
                 and (select sum(od.qty * price) from order_detail od where od.odde_od_id = o.od_id) < 30000000
                 then 500000
             when (select sum(od.qty * price) from order_detail od where od.odde_od_id = o.od_id) >= 30000000
                 and (select sum(od.qty * price) from order_detail od where od.odde_od_id = o.od_id) < 50000000
                 then 1000000
             when (select sum(od.qty * price) from order_detail od where od.odde_od_id = o.od_id) >= 50000000
                 then (select sum(od.qty * price) from order_detail od where od.odde_od_id = o.od_id) * 0.05
             else 0
            end) as total
    FROM shipper s
             INNER JOIN orders o
                        ON s.order_shipper_od_id = o.od_id
    inner join order_detail od on o.od_id = od.odde_od_id
    WHERE s.user_shippers_user_id = userShipperId and o.status = 'DELIVERED' and YEAR(o.recipient_date) = years
    GROUP BY MONTH(o.recipient_date);
END ;;
DELIMITER ;
