/*!50003 SET sql_mode              = 'STRICT_TRANS_TABLES,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `ThongKe_Top10_Product`(month int,year int)
BEGIN
    SELECT
        p.prod_name prodName,
        COUNT(o.qty) countQty,
        Sum(p.price_prod) countPrice,
        o2.recipient_date
    from order_detail o INNER JOIN products p on p.prod_id = o.prod_odde_prod_id
                        Join orders o2 on o.odde_od_id = o2.od_id where MONTH(o2.recipient_date) = month and
            YEAR(o2.recipient_date) = year
    group by p.prod_name,p.price_prod
    order by countQty DESC
    LIMIT 0,10;
End ;;
DELIMITER ;
