DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `ThongKe_Top10_ProductByYear`(year int)
begin
    SELECT
        p.prod_name prodName,
        COUNT(o.qty) countQty,
        Sum(p.price_prod) countPrice,
        o2.recipient_date
    from order_detail o INNER JOIN products p on p.prod_id = o.prod_odde_prod_id
                        Join orders o2 on o.odde_od_id = o2.od_id where
            YEAR(o2.recipient_date) = year
    group by p.prod_name,p.price_prod
    order by countQty DESC
    LIMIT 0,10;
end ;;
